import React from 'react'

const navLinks = [
    {
        title: 'Home',
        path: '/'
    },
    {
        title: 'blog',
        path: '/blog'
    },
    {
        title: 'Contact me',
        path: '/contact-me'
    },
    {
        title: 'Login',
        path: '/login '
    }
]

export default function Nav(){
    return (
        <nav className="site-navigation">
            <span>My WikiBlog</span>  
            <ul>
                { navLinks.map((link, index)=> (
                    <li key={index}>
                        {link.title}
                    </li>
                ))}
            </ul>          
        </nav>
    )
}
